import React from 'react';
import { NavLink} from 'react-router-dom';
const Header = () => {
    
    return (
        <div id="AppHeader">
                <NavLink className="navLink" to="/users" >Users</NavLink>&nbsp;&nbsp;          
                <NavLink  className="navLink" to="/enterprises">Enterprises</NavLink>&nbsp;&nbsp;
                  <NavLink  className="navLink" to="/contactUs">Contact Us</NavLink>&nbsp;
              
  
        </div>
    )
}
export default Header;
